import React from "react";
import { Route, Routes } from "react-router-dom";
const App = () => {
  return (
    <Routes>
      <Route index element={<Gymform />} />
      <Route path="home" element={<Home />} />
      <Route path="users" element={<Users />} />
      <Route path="*" element={<NoMatch />} />

    </Routes>
  );
};
export default App;
